import React, { Component } from 'react';
import axios from 'axios';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = { 
      title: '',
      body: '',
     }
  }

  postT(e) {
    const {title, body}  = this.state;
    axios.post('http://localhost:8000/api/posts/', {
      title,
      body
    })
  }

  render() { 
    return ( 
      <h1>Hello</h1>
     );
  }
}

export default App;
